import React from 'react';
import Roome from './Roome';

const RoomList = ({ rooms }) => {
    const { id, room } = rooms
    return (
        <>
            {rooms.map(item => {
                return <Roome key={ item.id } room={ item } />
            }) }
        </>
    );
};

export default RoomList;
